  false,\n\t\"url\": null,\n\t\"notes\": \"This report addresses Atlantic white cedar
  swamp restoration in North Carolina refuges. The ecology, use, and historical distribution
  of Atlantic white-cedar (AWC) in North Carolina has beendocumented by many authors.
  Lacking has been a statewide effort to map and quantify the locations and conditions
  of extant remnant stands. This inventory was commissioned by the U.S. Air Force
  to fulfill this research need. The specific purposes of the inventory are twofold;
  :first, to identify the location and condition of remnant AWC groves (areas less
  than 2 acres) and stands (areas 2 acres or greater) in North Carolina, and second,
  to compare those sites with remnant AWC sites on the DCR. By examining such data
  and comparisons, DCR officials will be able to view their forest management from
  a statewide perspective. The authors expect the report will also be used by other
  agencies, foresters, and ecologists interested in the perpetuation of AWC and its
  associated natural communities. This inventory is a comprehensive description of
  a statewide resource rather than a standard forest inventory that focuses on volumes
  and stocking. Therefore, for each site, the authors described dominant vegetation
  along with other ecological characteristics such as understory and herb layers,
  soils, past disturbances, and natural community types. It should be clearly noted
  that the authors do not claim this inventory to be exhaustive, however, it is extremely
  representative.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
